import React from 'react';
import './FrontPage.css';
const columns = [
    { key: 'firstName', label: 'FIRSTNAME' },
    { key: 'lastName', label: 'LASTNAME' },
    { key: 'email', label: 'EMAIL' },
    { key: 'mobileNumber', label: 'MOBILENUMBER' },
    { key: 'dob', label: 'DOB' },
];

function App() {
    return (
        <div className="App">
        <div class="logo">
        <img id="logo1" src="https://divum.in/images/logo/Divum_Logo%20SVG%20(2).svg"></img>
        </div>
            <table>
                <thead>
                    <tr>
                        {columns.map(column => (
                            <th key={column.key}>{column.label}</th>
                        ))}
                    </tr>
                </thead>
                <tbody>
                    {data.map((row, rowIndex) => (
                        <tr key={rowIndex}>
                            {columns.map(column => (
                                <td key={column.key}>{row[column.key]}</td>
                            ))}
                        </tr>
                    ))}
                </tbody>
            </table>
            <div class="btn">
           <button>ADD</button>
         </div>
        </div>
    );
}

export default App;
